            <img className={styles.elementsize }
                src={this.state.img2}
                onMouseEnter={() => {
                  this.setState({
                    img2: Red
                  });
                }}
                onMouseOut={() => {
                  this.setState({
                    img2: Cover
                            });
                          }}
                        />
                        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                        <img className={styles.elementsize }
                                      src={this.state.img3}
                                      onMouseEnter={() => {
                                        this.setState({
                                          img3:
                                            Yellow
                                        });
                                      }}
                                      onMouseOut={() => {
                                        this.setState({
                                          img3: Cover
                                        });
                                      }}
                                    />
                                    </span>
                                  </div>
     </div>

      );
    }
  }

render(<ElementsTraining />, document.getElementById("root"));

